import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Post from './Post';
function App() {
  return (
    <div class="App">
      <Post myId="1">Hello!</Post>
      <Post myId="2"><h1>Title</h1></Post>
      <Post myId="3"><Comment data="5 stars" /></Post>
    </div>
  );
}
export default App;
